$(document).ready(function() {
  $('#calendar').fullCalendar({
    eventClick: function(event) {
      console.log(event);
      if (event.ticketUrl) {
        var win = window.open(event.ticketUrl, '_blank');
        win.focus();
      }
    }
  });
  $.ajax({
    type: "POST",
    url: "https://xpfq2w11xh.execute-api.us-east-1.amazonaws.com/prod/events",
    data:  JSON.stringify({ ids: $("#calendar").data('bandsintown-ids') }),
    success: function(results) {
      $.each( results, function( key, value ) {
        var buildingEvents = $.map(value, function(item) {
          if (item.id&&item.datetime&&item.title&&item.ticket_url) {
            return {
              id: item.id,
              title: item.title,
              start: item.datetime,
              ticketUrl: item.ticket_url
            };
          }
        });
        $('#calendar').fullCalendar('renderEvents', buildingEvents, true);
      });
    }
  });
});
